import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import { useUserContext } from '../ListOfPolicies/UserContext';

function SignInPage() {
  const { updateUserData } = useUserContext();
  const navigate = useNavigate();
  const [FullName, setFullName] = useState('');
  const [Mobile, setMobile] = useState('');
  const [Email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [errorMessages, setErrorMessages] = useState({
    FullName: '',
    Mobile: '',
    Email: '',
    password: '',
  });

  const handleSubmit = (e) => {
    e.preventDefault();

    const isValid = validateInputs();

    if (isValid) {
      console.log('Form submitted:', {
        FullName,
        Mobile,
        Email,
        password,
      });

      const formData = {
        FullName,
        Mobile,
        Email,
        password,
      };

      axios.post('http://localhost:9856/api/signin', formData)
        .then(response => {
          console.log('Sign in successful:', response.data);
          updateUserData({ FullName, Mobile, Email });
          navigate('/success');
        })
        .catch(error => {
          console.error('Sign in failed:', error);
        });
    } else {
      console.log('Form submission failed. Please check the fields.');
    }
  };

  const handleInputChange = (fieldName, value, regex, errorMessage) => {
    setFieldValue(fieldName, value);
    validateInput(fieldName, value, regex, errorMessage);
  };

  const setFieldValue = (fieldName, value) => {
    switch (fieldName) {
      case 'FullName':
        setFullName(value);
        break;
      case 'Mobile':
        setMobile(value);
        break;
      case 'Email':
        setEmail(value);
        break;
      case 'password':
        setPassword(value);
        break;
      default:
        break;
    }
  };

  const validateInput = (fieldName, value, regex, errorMessage) => {
    const isValid = regex.test(value);
    setErrorMessages((prevErrors) => ({
      ...prevErrors,
      [fieldName]: isValid ? '' : errorMessage,
    }));
  };

  const validateInputs = () => {
    const isValidFullName = /.+/.test(FullName);
    const isValidMobile = /.+/.test(Mobile);
    const isValidEmail = /.+/.test(Email);
    const isValidPassword = /.+/.test(password);

    setErrorMessages({
      FullName: isValidFullName ? '' : 'Please enter your full name.',
      Mobile: isValidMobile ? '' : 'Please enter a valid 10-digit mobile number.',
      Email: isValidEmail ? '' : 'Please enter a valid email address.',
      password: isValidPassword ? '' : 'Password must be at least 8 characters, contain at least one letter, one number, and one special character.',
    });

    return isValidFullName && isValidMobile && isValidEmail && isValidPassword;
  };

  return (
    <div className='org1'>
      <form className='forinner1 container' onSubmit={handleSubmit}>
      <div className='form-group1 container '>
          <div>FullName:</div>
          <div className='form-group1Input container'>
            <input
              type='text'
              className=''
              placeholder='ex: FullName'
              value={formData.FullName}
              onChange={(e) => handleInputChange('FullName', e.target.value, /.+/, 'Please enter your full name.')}
            />
            <p className='error1-message1' style={{ color: 'red', textAlign:'center'}}>{errorMessages.FullName}</p>
          </div>
        </div>

        <div className='form-group1 container '>
          <div>MobileNo:</div>
          <div className='form-group1Input container'>
            <input
              type='text'
              className=''
              placeholder='ex: 9876543210'
              value={formData.Mobile}
              onChange={(e) => handleInputChange('Mobile', e.target.value, /^[987][0-9]{9}$/, 'Please enter a valid 10-digit mobile number.')}
            />
            <p className='error-message1' style={{ color: 'red', textAlign:'center' }}>{errorMessages.Mobile}</p>
          </div>
        </div>

        <div className='form-group1 container '>
          <div>EmailId:</div>
          <div className='form-group1Input container'>
            <input
              type='text'
              className=''
              placeholder='ex: example@gmail.com'
              value={formData.Email}
              onChange={(e) => handleInputChange('Email', e.target.value, /^[^\s!@#$%^&*@]+@[^\s@]+\.(com|in)$/, 'Please enter a valid email address.')}
            />
            <p className='error-message1' style={{ color: 'red', textAlign:'center' }}>{errorMessages.Email}</p>
          </div>
        </div>
        
        <div className='form-group1 container '>
          <div>password:</div>
          <div className='form-group1Input container'>
            <input
              type='password'
              className=''
              placeholder='ex: Abc@123'
              value={formData.password}
              onChange={(e) => handleInputChange('password', e.target.value, /(?=.*[0-9])(?=.*[@])(?=.*[A-Z])[A-Za-z0-9!@#$%^&*]{8,15}$/, 'Password must be at least 8 characters, contain at least one letter, one number, and one special character.')}
            />
            <p className='error-message1' style={{ color: 'red', textAlign:'center' }}>{errorMessages.password}</p>
          </div>
        </div>

        <button className='btn btn-success my-2' type='submit'>
          Sign In
        </button>
      </form>
    </div>
  );
}

export default SignInPage;
